import React from 'react'
import { nikeAir } from "../data";

function Home() {
    return (
        <div className="container">
            <h1>Welcome to this sneaker blog</h1>
            <div className="gallery">

                {nikeAir.map((item, i) => {
                    return (

                        <Link className="link" key={i} to={`/blog/${item.name}`} style={{ 'display': 'block' }}>
                            
                            </Link>
                        
                    )
                })}
            </div>
        </div>
    )
}

export default Home
